    false,nt"url": null,nt"notes": "Drawdowns, prescribed burns, chemical and
    mechanical control of pest plants, and fish restocking are planned for fisheries
    and lake rehabilitation on St. Vincent National Wildlife Refuge.  The document summarizes
    the impacts this rehabilitation is likely to have on critical species.  Eagle feeding
    areas will be temporarily impacted by this plan, but the eagles will be able to
    move to an alternate site.  Lake drawdowns could attract storks, so only beneficial
    effects are anticipated.  One or two eastern indigo snakes could be disturbed by
    mechanical manipulations or cattails; however, they should be easy to relocate.",nt"license_title":
